VALUES ('3259810009148', '3L Huile Olive Vierge Extra Soleou', 'foléou Créateur de goût HUILE D\'OLIVE VIERGE EXTRA EXTRAITE À FROID Huile pour assaisonnement et cuisson. Huile d\'olive de catégorie supérieure obtenue directement des olives et uniquement par des procédés mécaniques. SUGGESTIONS D\'UTILISATION : Cette huile sélectionnée par Soléou accompagnera tous vos plats : à cru sur vos salades ou bien en cuisson de vos légumes, viandes et poissons. ENGAGEMENTS SOLEOU - Le savoir-faire de créateur de goûts méditerranéens et notamment la sélection et l\'assemblage d\'huiles d\'olive choisies pour leurs qualités gustatives. - L\'implication dans le Développement Durable, et notamment dans sa dimension écologique dont cet emballage éco•conçu en est un parfait exemple. POURQUOI CHOISIR L\'EMBALLAGE BAGAlN80X? 1 ÉCOLOGIQUE Car composé à 80% de matériaux renouvelables et recyclés (carton) 2 QUALITÉ PRÉSERVÉE Car il protège idéalement l\'huile de la lumière et de l\'air (grâce à sa poche qui se rétracte au fur et à mesure que l\'huile est soutirée). Il préserve donc durablement les propriétés gustatives et nutritionnelles de l\'huile. 3 PRATIQUE Grâce à son verseur anti-goutte.', 'https://static.openfoodfacts.org/images/products/325/981/000/9148/front_fr.4.400.jpg', '100', '11.9', '0.01', '0.01', '', '0.01', '0', '0', '', '0');

